<!DOCTYPE html>
<html lang="zh-CN">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        * {
            margin: 0;
            padding: 0;
        }

        body,
        html {
            font-family: '微软雅黑', sans-serif;
            width: 800px;
            min-height: 400px;
            margin: 0;
            padding: 20px;
            text-align: center;
            background-color: transparent;
            /* 便签背景色 */
        }

        .content {
            display: grid;
            grid-template-columns: repeat(51, 1fr);
            grid-template-rows: repeat(51, 1fr);
            width: 800px;
            height: 800px;
            background: #fff;
            background-size: 100%;
        }

        .content .item {
            position: relative;
            box-sizing: border-box;
            border: 1px solid #000;
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: rgba(127, 255, 212, 0.011);
        }

        .content .item.my::before {
            position: absolute;
            content: '';
            top: 0;
            left: 0;
            z-index: 999;
            width: 100%;
            height: 100%;
            background: url(https://smmcat.cn/run/openworld/user.png) no-repeat;
            background-size: 80%;
            background-position: center center;
        }

        .content .item.path {
            background: url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
            background-size: 900%;
            background-position: 0px 0px;
        }

        .content .item.woods{
              background:url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
              background-size: 900%;
              background-position: -10% 0px;
          }
          .content .item.brook{
              background:url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
              background-size: 900%;
              background-position: -20% 0px;
          }
          .content .item.yamakawa{
              background:url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
              background-size: 900%;
              background-position: -30% 0px;
          }
          .content .item.diggings{
              background:url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
              background-size: 900%;
              background-position: -40% 0px;
          }
          .content .item.plain{
              background:url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
              background-size: 900%;
              background-position: -50% 0px;
          }
          .content .item.city{
              background:url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
              background-size: 900%;
              background-position: -60% 0px;
          }
          .content .item.tribe{
              background:url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
              background-size: 900%;
              background-position: -70% 0px;
          }
          .content .item.pit{
              background:url(https://smmcat.cn/run/openworld/mapItem.png) no-repeat;
              background-size: 900%;
              background-position: -80% 0px;
          }

        .content .item.other::before {
            position: absolute;
            content: '';
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: url(https://smmcat.cn/run/openworld/human.png) no-repeat;
            background-size: 80%;
            background-position: center center;
            background-color: #66ccff;
        }
    </style>
</head>
